import React from 'react'
import { useParams } from 'react-router-dom'

export default function Hostel() {

  const {id} = useParams();

  return (
    <>
    <div>Hostel {id} </div>

    <div style={{
            textShadow: "0 1px 0 rgba(255, 255, 255, .7), 0px 2px 0 rgba(0, 0, 0, .5)",
            textTransform: "uppercase",
            textAlign: "center",
            color: "#666",
            margin: "0 0 30px 0",
            letterSpacing: "4px",
            font: "normal 26px/1 Segoe Print,Verdana, Helvetica",
            position: "relative",
        }} >
          Hostel Name
        </div>

    </>


  )
}
